\\\" cellpadding=\\\"1\\\" border=\\\"1\\\">\\n\\t<tbody>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>Part of the Microscope</strong></td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\"><strong>Function</strong></td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td><strong>Eye piece lens</strong></td>\\n\\t\\t\\t<td>The lens you look through, normally 10x or 15x magnification.</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td><strong>Objectives</strong></td>\\n\\t\\t\\t<td>For increased magnification, usually 10x, 40x and 100x magnification.</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td><strong>Coarse focus adjustment knob</strong></td>\\n\\t\\t\\t<td>Moves the stage up or down and adjusts focus.</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td><strong>Fine focus adjustment knob</strong></td>\\n\\t\\t\\t<td>Slightly moves the stage to make very small adjustments for better focus.</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td><strong>Stage</strong></td>\\n\\t\\t\\t<td>Where the slide is held/placed.</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td><strong>Base</strong></td>\\n\\t\\t\\t<td>The bottom of the microscope used for stability.</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td><strong>Diaphragm/Iris</strong></td>\\n\\t\\t\\t<td>Varies intensity of the light projected upwards onto the slide.</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td><strong>Light source</strong></td>\\n\\t\\t\\t<td>Sends light onto the specimen/slide.</td>\\n\\t\\t</tr>\\n\\t</tbody>\\n</table>\\n\\n<div> </div>\\n</div>\\n\"},\"subContentId\":\"2d0b5d3f-13e8-45dc-a6b8-42407221f3bb\",\"metadata\":{\"contentType\":\"Table\",\"license\":\"U\",\"title\":\"Untitled Table\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Table\"}},\"alwaysDisplayComments\":true,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":6.0790273556231,\"y\":75.07507507507508,\"width\":90.647083530962,\"height\":17.665289350649,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Note:</strong> Objective lenses can be categorized into 3 main groups based on their magnification power. Low magnification objectives (4x and 10x),  intermediate magnification objectives (40x and 50x) and high magnification objectives (100x).</p>\\n\\n<p> </p>\\n\"},\"subContentId\":\"61ab429d-1ea5-4f1e-96ff-f3b220ffd463\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.5172234042553192,\"y\":3.003003003003003,\"width\":98.10536990881458,\"height\":89.64964984984985,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.125em\\\"><strong>The steps to prepare a microscope slide for the observation of an onion skin (plant cells) can be summarized by the following:</strong></span></p>\\n\\n<ol>\\n\\t<li><span style=\\\"font-size:1.125em\\\">Get an onion and cut a small slice.</span></li>\\n\\t<li><span style=\\\"font-size:1.125em\\\">Remove a thin layer of an onion skin using tweezers.</span></li>\\n\\t<li><span style=\\\"font-size:1.125em\\\">Place the thin layer on top of a microscope slide.</span></li>\\n\\t<li><span style=\\\"font-size:1.125em\\\">Add only one droplet of iodine to the specimen. </span></li>\\n\\t<li><span style=\\\"font-size:1.125em\\\">Slowly lower the cover slip over the specimen using a mounted needle.</span></li>\\n\\t<li><span style=\\\"font-size:1.125em\\\">The slide is ready to be viewed under the microscope.</span></li>\\n</ol>\\n\"},\"subContentId\":\"2e17f1ef-4154-465e-9921-2a68e75fb6d6\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.514691489361702,\"y\":3.003003003003003,\"width\":98.10536990881458,\"height\":96.55655675675676,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.125em\\\"><strong>The steps to prepare a microscope slide for the observation of cheek cells (animal cells) can be summarized by the following:</strong></span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">1. Place a drop of water on a clean microscope slide.</span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">2. Use a clean tooth pick to gently scrap the inner wall of your cheek.</span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">3. Mix the scrap on the tooth pick with the water on the microscope slide.</span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">4. Add one drop of stain (methylene blue) to the mixture.</span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">5. Remove excess water and methylene blue solution carefully.</span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">6. Place the cover slip slowly over the specimen.</span></p>\\n\\n<p><span style=\\\"font-size:1.125em\\\">7. The specimen is ready to be viewed under the microscope.</span></p>\\n\\n<p> </p>\\n\"},\"subContentId\":\"1ad34999-1b89-40a5-8c2a-f6e6167a26b7\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":0,\"y\":0,\"width\":100,\"height\":9.022556390977444,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><s
